// src/App.js
import './src/components/HeroSection.jsx'
import './src/components/PageLayout.jsx'
import './src/component/InfoCard.jsx'
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { CartProvider } from './context/CartContext';

// Layout Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import PhotoGallery from './components/PhotoGallery';
import Q from './components/Q';
import LiveBroadcast from './components/LiveBroadcast';
import PaymentForm from './components/PaymentForm';
import ShoppingCart from './components/ShoppingCart';

// Pages
import Chakras from './Pages/VibrationalIntelligence/Chakras';
import PackagingLabels from './Pages/VibrationalIntelligence/PackagingLabels';
import Fibonacci from './Pages/VibrationalIntelligence/Fibonacci';
import PinealGland from './Pages/VibrationalIntelligence/PinealGland';
import Numerology from './Pages/VibrationalIntelligence/Numerology';
import SacredGeometry from './Pages/VibrationalIntelligence/SacredGeometry';
import FrequencyChart from './Pages/VibrationalIntelligence/FrequencyChart';
import AboutUs from './Pages/AboutUs';
import HomePage from './Pages/HomePage';
import MAVJStore from './Pages/MAVJStore';
import Invest from './Pages/Invest';
import Checkout from './Pages/Checkout';
import Recipes from './Pages/Recipes';
import Herbs from './Pages/Herbs';
import Illnesses from './Pages/Illnesses';
import Sponsorship from './Pages/Sponsorship';
import Oils from './Pages/Oils';
import MAVJDetox from './Pages/MAVJDetox';
import ContactUs from './Pages/ContactUs';
import Journey2Enlightenment from './Pages/Journey2Enlightenment';
import AVSnacks from './Pages/AVSnacks';
import Seeds from './Pages/Seeds';
import MAVJSeaMoss from './Pages/MAVJSeaMoss';
import Consultations from './Pages/Consultations';
import Merchandise from './Pages/Merchandise';
import AVDrinks from './Pages/AVDrinks';
import Donate from './Pages/Donate';
import J2EAccommodations from './Pages/J2EAccommodations';
import J2EExcursions from './Pages/J2EExcursions';
import ProductCompendium from './Pages/VibrationalIntelligence/ProductCompendium';
import J2EAgro from './Pages/J2EAgro';
import J2EAqua from './Pages/J2EAqua';
import J2EWorkshops from './Pages/J2EWorkshops';
import J2EFood from './Pages/J2EFood';

function App() {
  return (
    <CartProvider> 
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/store" element={<MAVJStore />} />
          <Route path="/invest" element={<Invest />} />
          <Route path="/checkout" element={<Checkout />} />
          <Route path="/live-broadcast" element={<LiveBroadcast />} />
          <Route path="/recipes" element={<Recipes />} />
          <Route path="/herbs" element={<Herbs />} />
          <Route path="/illnesses" element={<Illnesses />} />
          <Route path="/Q" element={<Q />} />
          <Route path="/sponsorship" element={<Sponsorship />} />
          <Route path="/oils" element={<Oils />} />
          <Route path="/detox" element={<MAVJDetox />} />
          <Route path="/contact" element={<ContactUs />} />
          <Route path="/j2e" element={<Journey2Enlightenment />} />
          <Route path="/snacks" element={<AVSnacks />} />
          <Route path="/seeds" element={<Seeds />} />
          <Route path="/seamoss" element={<MAVJSeaMoss />} />
          <Route path="/consultations" element={<Consultations />} />
          <Route path="/merchandise" element={<Merchandise />} />
          <Route path="/about" element={<AboutUs />} />
          <Route path="/drinks" element={<AVDrinks />} />
          <Route path="/donate" element={<Donate />} />
          <Route path="/accommodations" element={<J2EAccommodations />} />
          <Route path="/excursions" element={<J2EExcursions />} />
          <Route path="/cart" element={<ShoppingCart />} />
          <Route path="/chakras" element={<Chakras />} />
          <Route path="/packaging-labels" element={<PackagingLabels />} />
          <Route path="/fibonacci" element={<Fibonacci />} />
          <Route path="/pineal-gland" element={<PinealGland />} />
          <Route path="/numerology" element={<Numerology />} />
          <Route path="/sacred-geometry" element={<SacredGeometry />} />
          <Route path="/frequency-chart" element={<FrequencyChart />} />
          <Route path="/product-compendium" element={<ProductCompendium />} />
          <Route path="/j2e-agro" element={<J2EAgro />} />
          <Route path="/j2e-aqua" element={<J2EAqua />} />
          <Route path="/j2e-workshops" element={<J2EWorkshops />} />
          <Route path="/j2e-food" element={<J2EFood />} />
          <Route path="/payment" element={<PaymentForm />} />
        </Routes>
        <PhotoGallery />
        <Footer />
      </Router>
    </CartProvider>
  );
}

export default App;
